Wet ingredients: 
-3 medium bananas mashed
-1/3 cup coconut sugar
-1/4 cup maple syrup
-1 tsp vanilla
-2 tbsp olive oil or vegan butter
-1/3 cup almond milk
-1 tsp Apple cider vinegar

Dry ingredients:
-1 cup whole grain flour
-3/4 cup all purpose flour
-1/4 cup almond flour
-1.5 tsp baking powder
