-3 tbsp cocoa powder
-1/3 cup boiling water (only using 1-2 tbsp)

Topping:
@enjoylifefoods mini chocolate chips!

Steps:
- preheat oven to 375 degrees
- mix wet and dry ingredients together then combine until mixed together 
-divide the batter into 2 bowls and add the cocoa powder + 1-2 tbsp boiling water to one bowl
-assemble your loaf in bread pan w/ batters and chocolate chips
